style.css:
/* Sample CSS style for Roblox Stylish */

/* Changing background color */
body {
  background-color: #f2f2f2;
}

/* Changing text color */
h1, h2, p {
  color: #333333;
}

/* Adding shadow to elements */
button, input {
  box-shadow: 2px 2px 5px #888888;
}

/* Changing font */
body {
  font-family: 'Arial', sans-serif;
}

/* Changing text size */
p {
  font-size: 18px;
}
